app.service("AuthenticationService",["$http","$state",function(o,n){var e=this;e.checkToken=function(e){var t={token:e};o.post("endpoints/checkToken.php",t).success(function(o){return"unauthorized"!==o?(console.log("Logged In"),o):(console.log("Logged out"),void n.go("login"))}).error(function(o){n.go("login")})}}]);